import React, { Component } from 'react';
import firebase from 'firebase';

class Nav extends React.Component {
    constructor(props) {
        super(props)

        this.logOut = this.logOut.bind(this)
    }
    render() {
        return <div>
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <a className="navbar-brand" href="#">Equipe de Ligne</a>
                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>

                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul className="navbar-nav mr-auto">
                        <li className="nav-item active">
                            <a className="nav-link" href="/">Accueil<span className="sr-only">(current)</span></a>
                        </li>
                        <li className="nav-item dropdown">
                            <a className="nav-link dropdown-toggle" href="#" id="navbarDropdown" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                                Utilisateurs
                            </a>
                            <div className="dropdown-menu" aria-labelledby="navbarDropdown">
                                <a className="dropdown-item" href="/account">Mon compte</a>
                                <a className="dropdown-item" href="/usersAccount">Comptes utilisateurs</a>
                            </div>
                        </li>
                        <li className="nav-item dropdown">
                            <a className="nav-link dropdown-toggle" href="#" id="navbarDropdown" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                                Rapports
                            </a>
                            <div className="dropdown-menu" aria-labelledby="navbarDropdown">
                                <a className="dropdown-item" href="/form">Rédiger rapport</a>
                                <a className="dropdown-item" href="/formList">Consulter rapport</a>
                            </div>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link disabled" href={this.logOut()}>Déconnexion</a>
                        </li>

                    </ul>

                </div>
            </nav >
        </div >;
    }
    logOut() {
        let that = this
        firebase.auth().signOut().then(function () {
            // Sign-out successful.
            that.setState({ connectedUser: null, isAdmin: false })
        }).catch(function (error) {
            // An error happened.
        });
    }

}

export default Nav;
